useEffect(() => {
    (async () => {

      const result = await axios("http://localhost:8000/tenantdata");

      setData(result.data);
      console.log(result.data);

    })();
  }, []);

  const tabledata = useMemo(
    () => [
      {
        // first group - Users
        Header: "Tenant Details",
        // group columns
        columns: [
          {
            Header: "Tenant ID",
            accessor: "id"
          },
          {
            Header: "Tenant",
            accessor: "tenant"
          },
          {
            Header: "Type",
            accessor: "type"
          },
          {
            Header: "User ID",
            accessor: "userid"
          }

        ]
      }
    ],
    []
  );

  return (
    <div className="App">
      <Tenanttable columns={tabledata} data={data} />
    </div>
  );
}
